import { GET_DETAIL , GET_COUNTRIES, POST_ACTIVITY , GET_ALL_COUNTRIES, GET_ALL_ACTIVITIES} from '../Actions/index';

const initialState = {
    city : {},
    searchCities: [],
};

const Reducer = (state=initialState, action) => {
    switch (action.type) {

     case GET_CITY :
         return {
             ...state,
             city : action.payload,
         }
    default :
    return state;
    }
}



export default Reducer;
